  return (
    <div id='guess-counter'>
      <img className='pokeball-counter grayscale' alt="" src='/assets/pokeball.png'/>
      <img className='pokeball-counter' alt="" src='/assets/pokeball.png'/>
      <img className='pokeball-counter' alt="" src='/assets/pokeball.png'/>
    </div>
  )
};

export default GuessCounter;
